import React from "react";
import {Link} from "react-router-dom";

const MenuInObject = () => {
    return (
        <div className="menu">
            <div className="menu-item active">
                <Link to="/NewObjects">Создать предмет</Link>
            </div>
        </div>
    );
};

export default MenuInObject;
